import React from 'react'
import { Link, useParams } from 'react-router-dom'


interface Props{
    page:number
    setPage:(number:number)=>void
}

export default function Pagination(props:Props) {
    const page = useParams()
    console.log(Number(page)===Number(props.page));
    console.log("trang "+ props.page + " param: "+page);


    return (
        <Link to={`/shop/${props.page}`}>
            <span onClick={()=>props.setPage(props.page)} 
            style={Number(useParams())===Number(props.page)? {border:"red"}:{border:"red"}}>{props.page}</span>
        </Link>
    )
}
